#include <algorithm>
#include <iostream>
#include <limits>
#include <numeric>
#include <queue>
#include <vector>

const std::string lucky = "";

int main() {
    std::cin.tie(nullptr);
    std::ios_base::sync_with_stdio(false);

    int T;
    std::cin >> T;

    while (T--) {
        int x;
        std::cin >> x;
        
        bool b;
        switch (lucky[x / 3]) {
            case '0':
                b = false;
                break;
            case '1':
                b = x % 3 == 1;
                break;
            case '2':
                b = x % 3 == 0;
                break;
        }

        if (b)
            std::cout << "lucky\n";
        else
            std::cout << "unlucky\n";
    }
	

    return 0;
}
